export const styles = {
  navigationBarBox: (theme) => ({
    width: "100%",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    position: "fixed",
    bottom: 30,
    [theme.breakpoints.down("sm")]: {
      bottom: 2,
    },
    navigationBar: {
      backgroundColor: "#7cc918",
      borderRadius: 15,
    },
    navigationBarActiveTab: {},
  }),
};
